.canvas-color-picker-item.canvas-color-p.value:
conic-gradient(
    var(--color-red),
    var(--color-yellow),
    var(--color-green),
    var(--color-blue),
    var(--color-purple),
    var(--color-red)
  )

.heading-counter-0 .el-h6 h6::before.value:
var(--heading-counter) counter(h1-counter) "." counter(h2-counter)
    "." counter(h3-counter) "." counter(h4-counter) "." counter(h5-counter) "."
    counter(h6-counter) ""

.heading-counter-1 .el-h6 h6::before.value:
var(--heading-counter) counter(h1-counter) "." counter(h2-counter)
    "." counter(h3-counter) "." counter(h4-counter) "." counter(h5-counter) "."
    counter(h6-counter) ""
